// import SampleCreateEdit from './components/SampleCreateEdit';
import SampleList from './components/SampleList';
import SampleShare from './components/SampleShare';
import './starterstyles.css';

function App() {
  return (
    <>
      <header className="page-header">
        <div className="header-logo">
          <h2>
            <a href="/" className="header-icon-link">SongTrax</a>
          </h2>  
        </div>
        <div className="header-app-description">
          <span>Create & Share Location Based Music Samples!</span>
        </div>
      </header>

      <main>
        <SampleList />

        <SampleShare />
      </main>

      <footer className="page-footer"></footer>
    </>
  );
}

export default App;
